import styles from './background.module.css'
import ParallaxMousemove from 'react-parallax-mousemove'

export default function Background() {

    const style = {
        outter: {
          position: 'relative',
          overflow: 'hidden',
          margin: 'auto'
        },
        inner: {
          position: 'absolute',
          margin:'auto',
          top:0,
          left:0,
          right:0,
          bottom:0,
          textAlign:'center'
        },
        infoLayerStyle: {
          position: 'relative',
        },
        bgLayerStyle: {
          position: 'absolute',
          height: '100%',
        }
      }

    return (
        <div>
           <ParallaxMousemove containerStyle={style.outter} fullHeight={true}>

            <ParallaxMousemove.Layer layerStyle={style.bgLayerStyle} config={{
                xFactor: -0.03,
                yFactor: 0.03,
                springSettings: {
                    stiffness: 50,
                    damping: 30
                }
                }}>

                <img className={styles.shadow} className={styles.img_style} src="/background_parallax/shadow.png" alt="Background"></img>

            </ParallaxMousemove.Layer>

            <div style={style.inner}>

                <ParallaxMousemove.Layer layerStyle={style.infoLayerStyle} config={{
                    xFactor: 0.03,
                    yFactor: -0.03,
                    springSettings: {
                        stiffness: 50,
                        damping: 30
                    }
                    }}>


                    <img className={styles.img_style} src="/background_parallax/layer_3.png" alt="Parallax Layer"></img>


                </ParallaxMousemove.Layer>

                <ParallaxMousemove.Layer layerStyle={style.infoLayerStyle} config={{
                    xFactor: 0.06,
                    yFactor: -0.03,
                    springSettings: {
                        stiffness: 50,
                        damping: 30
                    }
                    }}>


                    <img className={styles.img_style}  src="/background_parallax/layer_2.png" alt="Parallax Layer"></img>

                </ParallaxMousemove.Layer>

                <ParallaxMousemove.Layer layerStyle={style.infoLayerStyle} config={{
                    xFactor: 0.09,
                    yFactor: -0.03,
                    springSettings: {
                        stiffness: 50,
                        damping: 30
                    }
                    }}>


                    <img className={styles.img_style} src="/background_parallax/layer_1.png" alt="Parallax Layer"></img>

                </ParallaxMousemove.Layer> 

            </div>

           </ParallaxMousemove>
        </div>
    )
}
